import React,{useState} from 'react';
import {View,StyleSheet,Text,TouchableOpacity,TextInput,B}from 'react-native';
import { Ionicons,Entypo } from '@expo/vector-icons';

const SignInScreen=({navigation})=>{
    const [email,setEmail] = useState('');
    const [icon, setIcon] = useState("eye-with-line");
    const [password,setPassword] = useState('');
    const [showPassword,setShowPassword]= useState(false);

    togglePassword =  ()=>{
        icon==="eye"?(setIcon("eye-with-line"),setShowPassword(false)):(setIcon("eye"),setShowPassword(true));
    }

    return<View style={styles.container}>
    <Text style={styles.signUpTitle}>Login</Text>
    <Text style={styles.subTitle}>Bem-vindo ao Rainbow</Text>
    <Text style={styles.labelText}>E-mail</Text>
    <View style={styles.fieldBox}>
    <Ionicons name="md-person"  style={styles.iconInput} />
    <TextInput style={styles.input} onChangeText={(email)=>setEmail(email)} />
    </View>
    <Text style={styles.labelText}>Senha</Text>
    <View style={styles.fieldBox}>
    <Entypo name="lock" style={styles.iconInput} />
    <TextInput secureTextEntry={!showPassword} style={styles.input} onChangeText={(password)=>setPassword(password)} />
    <Entypo onPress={()=>togglePassword()} name={icon} style={styles.iconInput} />
    </View>
        <TouchableOpacity onPress={()=>onSubmit(email,password)}
        style={styles.signInButton}><Text style={styles.signInText}>Cadastrar</Text>
        </TouchableOpacity>
        <TouchableOpacity onPress={()=>{}}
        style={styles.fbButton}>
            <Entypo name="facebook-with-circle" style={styles.fbIcon} />
            <Text style={styles.fbText}>Connect with facebook</Text>
        </TouchableOpacity>
        <Text>
        <Text style={styles.signUpText}>NÃ£o possui uma conta? 
        </Text>
        </Text>
        </View>
};
const styles = StyleSheet.create({
    container:{
        marginHorizontal:40,
        marginTop:80
    },
    signUpTitle:{

        fontSize:32,
        fontWeight:"bold"
    },
    subTitle:{
        fontSize:20,
        fontWeight:'500',
        marginTop:10,
        marginBottom:30
    },
    labelText:{
        fontSize:15,
        fontWeight:'300',
        marginBottom:7,
        marginTop:35
    },  
    input:{
        fontSize:20,
        height:40,
        flex:5
        },
    iconInput:{
        flex:0.5,
        fontSize:24,
        alignSelf:'center',
        color:'black'
    },
    fieldBox:{
        flexDirection:'row',
        height:40,
        borderBottomColor:'black',
        borderBottomWidth:1
    },
    signInButton:{
        marginTop:80,
        height:60,
        borderRadius:30,
        backgroundColor:'#F8E921',
        justifyContent:'center'
    },
    signInText:{
        textAlign: "center",
        fontSize:24
    },
    fbButton:{
        marginTop:30,
        height:60,
        borderRadius:30,
        backgroundColor:'#0002FC',
        justifyContent:'center',
        flexDirection:'row'
    },
    fbText:{
        alignSelf: "center",
        fontSize:22,
        color:'white'
    },
    fbIcon:{
        alignSelf: "center",
        fontSize:30,
        color:'white',
        marginRight:10
    },
    signUpText:{
        alignSelf:"center",
        fontSize:18
    },
    signUpLink:{
        fontSize:18,
        fontWeight:"bold",
        alignSelf:"center"
    },
    signUpBox:{
        flexDirection:'row',
        alignItems:'center'
    }

});

export default SignInScreen;
